import React from "react";
import './LoginBox.css';

function LoginBox(){
    return (
        <div class='LoginBox'>
            <h1 class='Text'>로그인 해주시요!</h1>
            <div>
            <div class='ID'>
                <text>ID</text>
                <input type='text'></input>
            </div>
            </div>
        </div>
    );
}

export default LoginBox;
